(2,'안녕하세요','오늘 처음 이용해보려고 가입했습니다 혹시 보스목록에 혈맹 레이드 보스들도 추가 가능한가요?','CONFIRMED',88,1,1,'2025-11-20 08:55:34.406',1,'2025-11-18 02:54:03.002','2025-11-20 08:55:34.407'),
(3,'안녕하세요','오늘 처음 이용해봅니다. \n\n혹시나 혈맹 레이드 보스 추가 및 고정보스는 컷 시간을 등록을 못하여 혹시나 템이나왔을땐 잡은보스 관리에서 분배 입력이 불가능한지 아님 다른방법이 있는지 궁금합니다','CONFIRMED',88,1,1,'2025-11-20 08:55:28.417',1,'2025-11-18 02:58:49.321','2025-11-20 08:55:28.418'),
(4,'안녕하세요','안녕하세요 고정보스 도 컷시간을 일력해서 아이템 내용을 입력하게 해주실수있나요?','DONE',88,1,0,NULL,NULL,'2025-11-21 05:39:28.020','2025-11-25 04:19:40.416'),
(5,'혈 레이드 입력방법 개선','지인으로부터 내용 전달 받음','IN_PROGRESS',1,1,0,NULL,NULL,'2025-11-25 04:06:08.153','2025-11-25 04:06:21.644'),
(6,'보스젠 알림음이 너무 작아요..','소리를 지금보다 3배이상 키울 수 있는 볼륨 조절기능이 있으면 좋겠습니다. ㅎㅎ','IN_PROGRESS',67,1,0,NULL,NULL,'2025-12-09 12:38:58.405','2025-12-28 09:57:40.767');
